import React from 'react';
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();

  return (
    <div 
      className="relative flex items-center justify-center min-h-screen bg-cover bg-center"
      style={{ backgroundImage: `url('bg.jpg')` }} // Replace 'bg.jpg' with your actual image URL
    >
      {/* Overlay for readability */}
      <div className="absolute inset-0 bg-black bg-opacity-50"></div>

      {/* Content Section */}
      <div className="relative text-center text-white px-6 max-w-3xl">
        <h1 className="text-5xl font-extrabold mb-6">
          Welcome to Our Company
        </h1>
        <p className="text-lg leading-relaxed mb-8">
          We specialize in delivering exceptional web and app development services. 
          Join us and experience innovation like never before!
        </p>
        <button
          className="bg-blue-500 hover:bg-blue-600 py-3 px-6 text-lg font-semibold rounded shadow-lg transition duration-300"
          onClick={() => navigate('/dashboard')}
        >
          Get Started
        </button>
      </div>
    </div>
  );
};

export default Home;
